アリフマキラー 450ml<br>ブランド：アリフマキラー<br>販売・製造元：フマキラー<br><br>しつこいアリを殺虫し、侵入を防止する殺虫剤 アリ用です。<br>冷却効果で速攻殺虫します。<br>侵入防止効果が長続きします。<br>天然殺虫成分を配合しています。<br>ベタつきにくいクリーンタイプです。<br>超ロングノズル付き。<br>アルゼンチンアリにも効きます。<br> <br>用途【適用害虫】クロアリ、アルゼンチンアリ、羽アリ、クモ、セアカゴケグモ、ムカデ、ヤスデ、ゲジ、シロアリ、キクイムシ、ダンゴムシ、ワラジムシ、ケムシ、カメムシ、アリガタバチ、ガ、シバンムシ <br><br>使用方法<br>ロングノズルを水平に起こしてご使用ください。<br>・害虫への処理：直接噴射または、発生場所と周辺に噴射。<br>・巣穴への直接処理：ロングノズルを差し込んで噴射。<br>・アリの侵入防止：家の周り(アリの通り道)に噴射。<br> ご注意<br>【<br><br>使用上の注意<br>】●70秒以上連続噴射しない。<br>●定められた<br><br>使用方法<br>を必ず守る。<br>●人体に向けて噴射しない。<br>また噴霧を直接吸入しない。<br>●身体に異常を感じた場合は、使用を中止し、直ちに本剤がピレスロイド系殺虫剤であることを医師に告げて、診療を受ける。<br>●アレルギー症状やカブレなどを起こしやすい体質の人、妊婦は、薬剤に触れないよう注意しする。<br>●皮膚につかないよう注意し、ついた場合には直ちに石けんで充分洗う。<br>●眼に入らないよう注意し、入った場合は直ちに充分水洗いし、眼科医の手当てを受ける。<br>●飲食物、食器、おもちゃ、飼料、植物、ペットなどに噴霧がかからないように注意する。<br>特に魚類には充分注意する。<br>●桐のタンス、白木の家具、プラスチック面、カーテンなどの繊維製品、化粧板、自動車の塗装面等に薬剤がかかった場合、変色・変形することがあるので、かからないよう注意する。<br>●ニスなどの塗装面、壁、大理石など、材質によってはシミになる場合があるので、目立たない所で試してから使用する。<br>●忌避効果は数日間持続しますが、噴霧した材質等、条件により異なります。<br>●缶をさかさにして使用しない。<br>噴射ガスがなくなり薬剤が噴射できずに残ることがあります。<br>●換気すること。<br> 【保管上の注意】●小児の手の届かない場所に保管する。<br>●火気や直射日光をさけ、温度の低い場所に保管する。<br>引火、爆発のおそれがあります。<br>●水回りや湿気の多い場所に置かない。<br>缶が錆びてガス漏れや破裂の恐れがあります。<br>●暖房器具(ファンヒーター等)の周囲と高温になる場所、車内は温度が上がり破裂する危険があるので置かない。<br>【廃棄の方法】●火気のない戸外で使いきったことを確認する。<br>●ガス抜きキャップを使用して完全にガスを抜く。<br>●キャップはプラスチックごみ、容器を空き缶として捨てる。<br>※大量に残っている場合は、フマキラーお客様相談室までお問い合わせください。<br> <br>成分<br>【有効成分】ピレトリン、ファルネシルアセトン 火気と高温に注意高圧ガスを使用した可燃性の製品であり、危険なため、下記の注意を守ること。<br>1.炎や火気の近くで使用しないこと。<br>2.火気を使用している室内で大量に使用しないこと。<br>3.高温にすると破裂の危険があるため、直射日光の当たる所や火気等の近くなど温度が40度以上となる所に置かないこと。<br>4.火の中に入れないこと。<br>5.使いきって捨てること。<br>高圧ガス：LPガス<br> 原産国日本 <br><br>お問い合わせ先<br>フマキラー株式会社 お客様相談室TEL：0077-788-555TEL：03-3255-6400 <br>日用品／虫よけ・殺虫剤・忌避／殺虫剤／殺虫剤 アリ用<br>JANコード： 4902424434262<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
