フマキラー アリ・ムカデ粉剤 600g<br>ブランド：<br>販売・製造元：フマキラー<br><br>特殊コーティングで雨に強く効果が持続し、家の周りにまくだけでイヤな害虫を寄せ付けない不快害虫忌避剤です。<br>除虫菊から取った天然殺虫成分「ピレトリン」を配合。<br>アリなどの不快害虫に直接散布して駆除することもできます。<br>舞い散りが少なく、イヤなニオイもしにくくなっています。<br>アルゼンチンアリにも効果を発揮します。<br> <br>有効成分等ピレトリン、カルバリル、ピペロニルブトキサイド、シリコーンオイル、鉱物質、その他1成分 <br><br>使用方法<br>【使用量の目安】1平方メートルあたり10-15押し(細口の場合、軽く1押しで5-10g出ます)●アリなどの不快害虫に直接散布するか、よく見かけるところへ均一に散布してください。<br>●屋内に侵入してくるムカデなどには、東屋の外壁や基礎コンクリートにそってその周辺に帯状3-5cm幅で盛り上がるように散布してください。<br>●花壇や鉢に侵入するアリなどにはその周辺に帯状に散布してください。<br>●アリの通路や巣の周辺に帯状にまくと効果的です。<br> 適用害虫ムカデ、クロアリ、アカアリ、アルゼンチンアリ、シロアリ、ダンゴムシ、ワラジムシ、ヤスデ、ゲジ、クモ、ケムシ、カメムシ、シバンムシ、アリガタバチ <br><br>使用上の注意<br>●定められた<br><br>使用方法<br>・使用量を必ず守り、使いすぎないようにする。<br>間違った使い方をすると効力不足や身体に異常を感じるおそれがある。<br>●アレルギー症状やカブレなどを起こしやすい体質の人、喘息の症状のある人、病人、妊婦、乳幼児等がいる場所では使用しない。<br>●環境を汚染しないために乱用は避ける。<br>また、井戸、地下水等の水質を汚染するおそれのある場所、蜜蜂、蚕、魚や水産動物等に被害を及ぼすおそれのある場所では使用しない。<br>●飲食物、食器、おもちゃ、観賞魚などのペット類、飼料、野菜などに薬剤がかからないよう注意する。<br>●散布する時はなるべく体の露出部を少なくして、風向きに注意し、吸い込んだり、身体にかからないようにする。<br>●皮膚についた場合は、直ちに石けんでよく洗う。<br>●眼に入った場合は、こすらず直ちに水でよく洗い流す。<br>●身体に異常を感じた場合や誤って薬剤を飲み込んだ場合は、直ちに本剤の製品名と成分名を医師に告げて、診療を受ける。<br>●薬剤の散布中は喫煙、飲食等はしない。<br>●散布場所に小児やペットが近寄らないよう注意する。<br>●薬剤が自動車、壁などの塗装面にかからないよう注意する。<br>●強い雨の場合は、薬剤が流れて効果がなくなることがあるので、改めて散布する。<br>●残った薬剤を他の容器に入れ替えない。<br> 保管および廃棄上の注意■保管上の注意・使用後は広口と細口の両方のキャップを閉めて、飲食物、食器などと区別し、小児の手の届かない湿気の少ない涼しい場所に保管する。<br>■廃棄上の注意・使用済の空容器は、プラスチックゴミとして捨てる。<br><br> 原産国インドネシア <br><br>お問い合わせ先<br>フマキラー株式会社 お客様相談室TEL：0077-788-555、03-3255-6400 <br>日用品／虫よけ・殺虫剤・忌避／忌避用品／不快害虫忌避剤<br>JANコード： 4902424432671<br><br>CS：16<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
