コバエバリア キッチン用 200ml<br>ブランド：フマキラー コバエバリア<br>販売・製造元：フマキラー<br><br>100%食品成分で寄せ付けない、除菌・消臭プラスの虫よけ対策スプレーです。食品成分でできでいるので、キッチンでも安心してご使用いただけます。シナモンに含まれる食品成分((E)-3-フェニルプロペナール)を発酵アルコールのWパワーでコバエを寄せ付けず、発生を抑えます。発酵アルコールがコバエの体表をつつんで窒息させ駆除します。植物由来の消臭成分配合で気になるニオイを消臭、除菌効果もあります。 <br>適用害虫ショウジョウバエ(コバエ) <br><br>使用方法<br>●噴射口を回し「ON」にしてご使用ください。使用後は「OFF」にしてください。●10-20cmの距離から噴射してください。●忌避する場合(成虫)：三角コーナー、ストレーナー、ゴミ箱等、コバエを寄せ付けたくない場所に噴射してください。三角コーナー/3吹き程度、ゴミ箱(45L)/9吹き程度●処理後、忌避効果が持続します。※使用状況によっては異なります。●直接駆除する場合：生ゴミ上にいる成虫・幼虫・卵に、全体が充分濡れるように直接噴射してください。※飛んでいるコバエには噴霧しないでください。●適用害虫ショウジョウバエ(コバエ) <br><br>使用上の注意<br>●飲まない。●用途以外に使用しない。●使用時は換気をよくし、噴霧を直接吸入しない。●目に入った時はこすらず流水で洗い流し、飲み込んだ場合は多量の水を飲ませ、医師に相談する。●皮膚についたときは石鹸で充分に洗う。●小児の手の届く所、高温になる所には置かない。●身体に異常を感じた場合は多量の水を飲ませ、医師に相談する。●シミ・変色の原因となるので、水性ワックス・ペンキ・ニスなどの塗装面、アクリル製やスチロール製のプラスチックなどに使用しない。●飲食物、食器、飼料、鑑賞魚、小鳥などのペット類、植物にかからないようにする。●引火の恐れがあるので、火気には充分注意する。●ガス警報器が作動することがあるので注意する。●使用後の容器はプラスチックごみとして捨てる。 成分有効成分：(E)-3-フェニルプロペナール、エタノール(発酵アルコール)、柿抽出物 <br><br>お問い合わせ先<br>フマキラー株式会社 お客様相談室：0077-788-555、03-3255-6400 <br>日用品／虫よけ・殺虫剤・忌避／虫除け(虫よけ)／コバエよけ<br>JANコード： 4902424429978 <br><br>新成分「（Ｅ）‐３‐フェニルプロペナール」配合で、２倍の持続効果を実現（当社従来品比較）。<br>全て食品成分なので、キッチンでも安心して使えます。<br>殺虫＋忌避＋発生予防のトリプル効果でコバエを一掃。除菌・消臭効果で、気になる菌やニオイにも効果を発揮。<br>生ゴミにスプレーすると、コバエが好む果実の腐敗臭などのニオイを抑える効果があります。<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
