【ナチュラス 天然ハーブのゴキブリよけの詳細】<br>
●おくだけ簡単なゴキブリよけです。化学合成殺虫剤を使用していないので、お子様やペットのいるご家庭にもおススメです！<br>
●本品は開封後約1ヵ月間効果があります。（使用環境により異なります。）<br>
●ナチュラルミントの香り。<br><br>

【効能・効果】<br>
ゴキブリの忌避<br><br>

【使用方法】<br>
1.袋の端を印に沿って切り取ってください。<br>
2.袋の反対側を引っ張り、容器から袋を引き抜いてください。薬剤がセットされ、揮散が開始します。<br>
3.設置する際は容器を立てるか横にして（横にする場合は穴を上にして）ご使用ください。<br><br>

【ご注意】<br>
○万一身体に異常が起きた場合は、直ちに本剤がハッカ油を含むことを医師に告げて、診療を受けてください。<br>
○本品はゴキブリの駆除を目的としたものではありません。<br>
○定められた用法用量を守ってください。用途以外に使用しないでください。<br>
○本品は容器が収容されていますので、容器から内容物を取り出さず、そのまま使用してください。<br>
○使用期間を過ぎても香りが残ることがありますが、十分な効果が期待出来ないので、1ヵ月を目安に交換してください。<br>
○本品は食べられません。誤って口に入れたときは、水でよくすすいでください。皮膚についたときは、石けんを用いてよく洗ってください。<br>
○使用中気分が悪くなった場合は、直ちに使用をやめ、速やかに換気してください。<br>○使用中及び使用後は子供の手に触れさせないようにしてください。<br>
○使用済みのものは子供がもてあそばないように注意し、ほかに転用しないで速やかにプラスチックゴミとして廃棄してください。<br>
○プラスチック、木材、紙製のキッチン用品等にハッカのニオイが付くことがありますが、洗浄もしくはしばらく放置することでニオイはとれます。<br>
○シリコンについてはニオイがついてとれない場合がありますので、シリコン製の食器の周りでは使用しないでください。<br>
○変形、変色のおそれがあるので、スチロール製の食器や、ウレタン塗装、漆塗装がされている食器の周りでは使用しないでください。<br>
○本品の上に直接ものを置かないでください。<br>
○火気の近くや直射日光のあたる場所、高温になる場所を避け、子供の手の届かないところに置いてください。<br><br>

